ERROR_CODES.OBJECT_LINK_INVALID_CHOICE.__doc__ = "Invalid choice for object link."
ERROR_CODES.OBJECT_LINK_NO_CHOICES.__doc__ = "No choices available."
ERROR_CODES.READ_ONLY_ATTRIBUTE.__doc__ = "Read only attribute."
